import React, { useEffect, useState } from 'react';

function LastCallsPage() {
  const [calls, setCalls] = useState([]);

  useEffect(() => {
    fetch('/api/queue/last-calls')
      .then(res => res.json())
      .then(data => setCalls(data));
    // Можно добавить setInterval для автообновления
  }, []);

  return (
    <div>
      <h2>Последние вызовы</h2>
      <ul>
        {calls.map((call, idx) => (
          <li key={idx}>
            Номер: {call.number} — Время: {call.timestamp}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default LastCallsPage;
